タスクに割り当てられた担当グループを取得する。
<p/> 担当グループは、実行順でソートされて返却される。 
@return 担当グループ

タスクに割り当てられた担当ユーザを取得する。
<p/> 担当ユーザは、実行順でソートされて返却される。 
@return 担当ユーザ

以下の情報を含む、ワークフローインスタンスの文字列表現を返却する。
<p/> インスタンスID ワークフローID バージョン アクティブフローノードのフローノードID 
@return ワークフローインスタンスの文字列表現

ワークフロー定義に従ってワークフローを進行させ、ワークフローインスタンスのアクティブフローノードを次のタスクもしくは停止イベントに進行させる。
<p/> タスクを完了させるユーザには、{@link ThreadContext#getUserId()} が利用され、ワークフローを進行させる際のパラメータには、空のMapが利用される。 
@link ThreadContext#getUserId()} に対してアクティブタスクが見つからない場合。
@see #completeTask(Map, String)

ワークフロー定義に従ってワークフローを進行させ、ワークフローインスタンスのアクティブフローノードを次のタスクもしくは停止イベントに進行させる。
<p/> ワークフローを進行させる際のパラメータには、空のMapが利用される。 
@link ThreadContext#getUserId()} に対してアクティブタスクが見つからない場合。
@see #completeTask(Map, String)

ワークフロー定義に従ってワークフローを進行させ、ワークフローインスタンスのアクティブフローノードを次のタスクもしくは停止イベントに進行させる。
<p/> タスクを完了させるユーザには、{@link ThreadContext#getUserId()} が利用される。 
@link ThreadContext#getUserId()} に対してアクティブタスクが見つからない場合。
@see #completeTask(Map, String)

ワークフロー定義に従ってワークフローを進行させ、ワークフローインスタンスのアクティブフローノードを次のタスクもしくは停止イベントに進行させる。
<p/> アクティブフローノードの {@link FlowNode#processNode(String, Map, String)} を実行して、ワークフローを現在のフローノードから進行させるかどうかを判断する。 現在のフローノードから進行させる場合には、次のタスクもしくは停止イベントに進行させ、進行先フローノードのアクティブ化処理を実行する。 
@link ThreadContext#getUserId()} に対してアクティブタスクが見つからない場合、またはワークフローが既に完了している場合。

すでに開始されているワークフローのインスタンスを取得する。
<p/> ワークフローがすでに完了している場合など、指定されたインスタンスIDを持つワークフローインスタンスが存在しない場合には、 {@link IllegalArgumentException} が送出される。 
@return 取得されたワークフローインスタンス

