<p/> 担当グループは、実行順でソートされて返却される。 
@return 担当グループ

タスクに割り当てられた担当ユーザを取得する。
<p/> 担当ユーザは、実行順でソートされて返却される。 
@return 担当ユーザ

指定されたワークフローIDのワークフローを開始する。
<p/> ワークフローの進行に利用するパラメータには、空のMapが利用される。 
@return 開始されたワークフローのインスタンスをあらわす {@link Workflow}
@see #start(String, Map)
@see WorkflowDefinitionHolder

指定されたワークフローIDのワークフローを開始する。
<p/> 開始されたワークフローインスタンスでは、開始イベントから進行して、最初に存在するタスクがアクティブフローノードとなっている。 開始イベントから、次のタスクまで進行させる際には、 {@code parameter} が各フローノードでの処理に使用される。 開始されるワークフロー定義の決定ロジックについては、 {@link WorkflowDefinitionHolder#getWorkflowDefinition(String)} を参照。 
@return 開始されたワークフローのインスタンスをあらわす {@link Workflow}
@see WorkflowDefinitionHolder

以下の情報を含む、ワークフローインスタンスの文字列表現を返却する。
<p/> インスタンスID ワークフローID バージョン アクティブフローノードのフローノードID 
@return ワークフローインスタンスの文字列表現

アクティブフローノードから、境界イベントトリガーIDに対応する境界イベントを取得し、現在のタスクを中断して、境界イベントから取得される進行先フローノードに ワークフローを進行させる。
<p/> ワークフローを進行させる際のパラメータには、空のMapが利用される。 
@see #triggerEvent(String, Map)

